import React from 'react';
import Sports from './containers/SportsContainer';
import General from './containers/GeneralContainer';
import Politics from './containers/PoliticsContainer';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="newsbox">< Sports /></div>
      <div className="newsbox">< General /></div>
      <div className="newsbox">< Politics /></div>

    </div>
  );
}

export default App;
